  \"Status of the merlin (Falco c. columbarius) in interior Alaska: 1989 progress
  report\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\": 0\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-07-27T23:02:43.226804\",\n\t\"name\":
  \"status-of-the-merlin-falco-c-columbarius-in-interior-alaska-1989-progress-report\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Seventeen merlin nests were located in
  the vicinity of the road corridor in Denali National Park and Preserve. Eleven nest
  sites were in live spruce trees, one was in a spruce snag, one was in a willow,
  and four were on the ground. Mean clutch size was 4.8 (n = 9). Fifty-two nestlings
  were banded, representing 3.25 young banded per active nest for nests where the
  outcome was known (n = 16). A total of 25 adult merlins were captured, representing
  19 unbanded and six previously banded individuals. Since the adult trapping efforts
  began in earnest in 1987, four nestling males have been recaptured as breeders,
  while no females banded as nestlings have been encountered. Environmental contaminant
  analysis of three addled eggs collected in 1988 has been completed and the organochlorine
  scan indicated an arithmetic mean of 7.5 ppm wet weight DDE. Trace amounts of otherorganochlorines
  were found, notably mirex, which is used in the southern U.S., central and South
  America.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
